const initialValues = {
  name: "",
  mobile: "",
  email: "",
  age: "",
  bloodgroup: "",
  address: "",
};

const index = () => {
  return (

    <Formik
      initialValues={initialValues}
      onSubmit={(values, { resetForm }) => {

        console.log(values);  
      }}
    >
       {({ values, handleChange, handleBlur, handleSubmit }) => {
        console.log(values);
