        <Box style={{ display: "flex" }}>
          <Box
            style={{
              flex: 2,
              padding: "0px 20px",
              height: "100%",
              backgroundColor: "white",
            }}
          >
            <Box
              style={{
                display: "flex",
                flexDirection: "row",
                justifyContent: "spacebetween",
              }}
            >
              <Input
                 name="name"
                 value={values.name}
                 onChange={handleChange}
                type="text"
                placeholder="Full Name "
                disableUnderline={true}
                onChange={handleChange}
                style={{
                  borderRadius: "4px",
                  marginTop: "20px",
                  backgroundColor: "#F1F1F1",
                  marginRight: "20px",
                  padding: "10px",
                  border: "1px solid  #E5E5E5 ",
                }}
              >
                hello
              </Input>

              <Input
               name="mobile"
               value={values.mobile}
               onChange={handleChange}
