                type="text"
                placeholder="Email "
                disableUnderline={true}
                style={{
                  borderRadius: "4px",
                  marginTop: "20px",
                  backgroundColor: "#F1F1F1",
                  marginRight: "20px",
                  padding: "10px",
                  border: "1px solid  #E5E5E5 ",
                }}
              >
                hello
              </Input>

              <Input
                type="number"
                placeholder="Age "
                disableUnderline={true}
                style={{
                  borderRadius: "4px",
                  marginTop: "20px",
                  backgroundColor: "#F1F1F1",
                  marginRight: "20px",
                  padding: "10px",
                  border: "1px solid  #E5E5E5 ",
                }}
              >
                hello
              </Input>
            </Box>
            <Box
              style={{
                display: "flex",
