                  backgroundColor: "#F1F1F1",
                  marginRight: "20px",
                  padding: "10px",
                  border: "1px solid  #E5E5E5 ",
                }}
              >
                hello
              </Input>
            </Box>
            <Box
              style={{
                display: "flex",
                flexDirection: "row",
                justifyContent: "space-around",
              }}
            >
              <Button
                style={{
                  marginTop: "40px",
                  padding: "10px",
                  marginBottom: "20px",
                }}
                variant="contained"
                color="primary"
              >
                Submit
              </Button>
              <Button
                style={{
                  marginTop: "40px",
                  padding: "10px",
                  marginBottom: "20px",
                  backgroundColor: "#898895",
                }}
                variant="contained"
                color="black"
                backgroundColor="#898895"
              >
                Reset
              </Button>
            </Box>
          </Box>
          <Box
            style={{
              flex: 2,
              padding: "0px 20px",
              height: "100%",
              backgroundColor: "#898895",
            }}
          ></Box>
        </Box>
      </Box>
    </div>
       </form>
       );
          }}
    </Formik>
  );
};
export default index;
